import { useEffect, useState } from "react"

const Header = (props) => {

    const [white, setWhite] = useState(0)

    useEffect(() => {

        if (props.class === 'black') {
            setWhite(1);
        }

        return () => (
            setWhite(0)
        )

    })

    return (
        <div className="headers-holder">
            <h2 className="info-headers" data-aos="fade-up">{props.title}</h2>
        </div>
    )


}

export default Header
